            this.obj = OFD.OFD.OCX.init("objectdiv", width, height);
            this.obj.ready(this.obj._id);
            if (!("ActiveXObject" in window)) {
                this.obj.jsCallbackFun_InitSetting();
                this.obj.jsCallbackFun_UpdateInfo();
